import styled from "styled-components";

const HeaderComp = styled.header`
  width: 100%;
  height: 120px;
  position: fixed;
  z-index: 100;
  top: 0;
  background-color: #ccc;
  .header_inner {
    width: 80%;
    margin: 0 auto;
    display: flex;
  }
  h1 {
    margin: 0;
  }
`;
export default HeaderComp;
